import React from 'react';
import { Outlet, Link } from "react-router-dom";
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
//  @import url("https://fonts.googleapis.com/css?family=Open+Sans:300,400,700");
import reportWebVitals from './reportWebVitals';
import ErrorPage from './error-page';
import Canvasviewer from './canvasviewer';
import Listofpatients from './listpatient';
import Conversation from './pc';
import QuestionForm from './addflow';
import Flowchart from './flowtree.js';
import Header from "./header";
import Dropdown from "./graph.js";
// import ReactFlowRendererFever from './graphs/fever';
import ReactFlowRenderer from './graphs/ReactFlowRenderer';

import {nodes as fevernodes, edges as feveredges} from './graphs/fever_elements';
import {nodes as headachenodes, edges as headacheedges} from './graphs/headache_elements';
import {nodes as coughnodes, edges as coughedges} from './graphs/cough_elements';
import {nodes as vomitingnodes, edges as vomitingedges} from './graphs/vomiting_elements';


const data = [{
  "symptom": "symptom",
  "questions": [
    {
      "ques" : "question1",
      "condition":{
        "yes":["Nested question 1","Nested question 2" ],
        "no":["NQ3" ],
      }
    }
  ]
}]
;
const myDataString = '{"one":1, "two":2, "array":[true, false, "string"]}';
const myDataObject = {
  one: 1,
  two: 2,
  array: [
    true,
    false,
    'string',
  ],
};

const jsond = [ {
  "symptom": "Fever",

    "questions": [
        {
        "ques" : "How long have you experienced fever?"
        },
        {
        "ques" : "Do you have rashes on any part of the body?"
        },
        {
        "ques" : "Do you have breathlessness/ effortfull breathing/ shortness of breath?"
        },
        {
        "ques" : "Is it associated with aches and pain?",
        "condition":{
            "yes":["Do you also have any othrer symptoms such as dry cough, sore throat, and stuffy or runny nose?",
                    "Do you also have vomiting and diarrhea?"
                ]
        }
        },
        {
        "ques" : "Do you have abdominal pain?",
        "condition":{
            "yes":["Is it asociated with cough?",
                    "Do you have generalised weakness?"
                ]
        }
        },
        {
        "ques" : "Is it associated with headache and tiredness"
        },
        {
        "ques" : "Do you experience confusion and dis-orientation?",
        "condition":{
            "yes":["Do you generally breath fast and shallow?",
                    "Do you experience seizures?",
                    "Have you ever experienced loss of consciousness?"
                ]
        }
        },
        {
        "ques" : "Have you experienced muscle and joint pain?",
        "condition":{
            "yes":["Is it associated with headaches?",
                    "Is it associated with shivering and sweating?",
                    "Have you ever experienced loss of appetite?",
                    "Is it associated with diarrhea and vomiting?"
                ]
        }
        }
    ]
}
]
const options = [
  {
    label: "Fever",
    url: "http://localhost:3000/graph/fever",
  },
  {
    label: "Cough",
    url: "http://localhost:3000/graph/cough",
  },
  {
    label: "Headache",
    url: "http://localhost:3000/graph/headache",
  },
  {
    label: "Vomiting",
    url: "http://localhost:3000/graph/vomiting",
  },
];


const router = createBrowserRouter([
  {
    path: "/",
    element: <App/>,
    errorElement : <ErrorPage/>
  },
  {
    path : "/mark",
    element : <Canvasviewer/>
  },
  {
    path : "/dashboard",
    element : <Listofpatients/>
  },
  {
    path : "/patientconvo",
    element : <Conversation/>
  },
  {
    path : "/addflow",
    element : <QuestionForm/>
  },
  {
    path : "/visualizeflow",
    // element : <JsonTree expanded dataString={myDataString} />
    // element : <Tree apiUrl="http://localhost:5001/fetchalldata" />
    // element : <JsonViewer/>
    element : <Flowchart data={data} />

  },
  {
    path : "/graph",
    element :<Dropdown options={options} />

  },
  {
    path : "/graph/fever",
    element :<ReactFlowRenderer initialEdges={feveredges} initialNodes={fevernodes}/>
  },
  {
    path : "/graph/cough",
    element :<ReactFlowRenderer initialEdges={coughedges} initialNodes={coughnodes}/>
  },
  {
    path : "/graph/headache",
    element :<div><Dropdown options={options} /> <ReactFlowRenderer initialEdges={headacheedges} initialNodes={headachenodes}/> </div> 
  },
  {
    path : "/graph/vomiting",
    element :<div><Dropdown options={options} /> <ReactFlowRenderer initialEdges={vomitingedges} initialNodes={vomitingnodes}/> </div> 
  },
]);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>
);

reportWebVitals();
